angelog\";s:3563:\"<p>1.4.6 (May 28, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue of custom contact fields ignored in export file.</li>\n</ul>\n<p>1.4.5 (March 25, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue of incorrect mapping of quiz result in csv file.</li>\n</ul>\n<p>1.4.4 (August 27, 2020)</p>\n<ul>\n<li>Feature: Added date filter.</li>\n</ul>\n<p><strong>1.4.3 (July 21, 2020)</strong></p>\n<ul>\n<li>Enhancement: Added QSM CORE 7.0.0 support.</li>\n</ul>\n<p><strong>1.4.2 (Mar 3, 2020)</strong></p>\n<ul>\n<li>Ability to export URL Parameters</li>\n</ul>\n<p>1.4.1 (April 26, 2016)</p>\n<ul>\n<li>Minor update to the name of the filters</li>\n</ul>\n<p>1.4.0 (April 26, 2016)</p>\n<ul>\n<li>Modularized the code by moving various tasks to own functions</li>\n<li>Added filters for header row and results rows to allow devs to modify and add columns to the CSV files</li>\n</ul>\n<p>1.3.0 (April 6, 2016)</p>\n<ul>\n<li>Added ability to export points earned for each question</li>\n<li>Added ability to export question\'s category</li>\n<li>Fixed bug incorrectly showing the correct/incorrect values</li>\n<li>Added new software license system</li>\n</ul>\n<p>1.4.5 (March 25, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue of incorrect mapping of quiz result in csv file.</li>\n</ul>\n<p>1.4.4 (August 27, 2020)</p>\n<ul>\n<li>Feature: Added date filter.</li>\n</ul>\n<p><strong>1.4.3 (July 21, 2020)</strong></p>\n<ul>\n<li>Enhancement: Added QSM CORE 7.0.0 support.</li>\n</ul>\n<p><strong>1.4.2 (Mar 3, 2020)</strong></p>\n<ul>\n<li>Ability to export URL Parameters</li>\n</ul>\n<p>1.4.1 (April 26, 2016)</p>\n<ul>\n<li>Minor update to the name of the filters</li>\n</ul>\n<p>1.4.0 (April 26, 2016)</p>\n<ul>\n<li>Modularized the code by moving various tasks to own functions</li>\n<li>Added filters for header row and results rows to allow devs to modify and add columns to the CSV files</li>\n</ul>\n<p>1.3.0 (April 6, 2016)</p>\n<ul>\n<li>Added ability to export points earned for each question</li>\n<li>Added ability to export question\'s category</li>\n<li>Fixed bug incorrectly showing the correct/incorrect values</li>\n<li>Added new software license system</li>\n</ul>\n<p><strong>1.4.3 (July 21, 2020)</strong></p>\n<ul>\n<li>Enhancement: Added QSM CORE 7.0.0 support.</li>\n</ul>\n<p><strong>1.4.2 (Mar 3, 2020)</strong></p>\n<ul>\n<li>Ability to export URL Parameters</li>\n</ul>\n<p>1.4.1 (April 26, 2016)</p>\n<ul>\n<li>Minor update to the name of the filters</li>\n</ul>\n<p>1.4.0 (April 26, 2016)</p>\n<ul>\n<li>Modularized the code by moving various tasks to own functions</li>\n<li>Added filters for header row and results rows to allow devs to modify and add columns to the CSV files</li>\n</ul>\n<p>1.3.0 (April 6, 2016)</p>\n<ul>\n<li>Added ability to export points earned for each question</li>\n<li>Added ability to export question\'s category</li>\n<li>Fixed bug incorrectly showing the correct/incorrect values</li>\n<li>Added new software license system</li>\n</ul>\n<p><strong>1.4.2 (Mar 3, 2020)</strong></p>\n<ul>\n<li>Ability to export URL Parameters</li>\n</ul>\n<p>1.4.1 (April 26, 2016)</p>\n<ul>\n<li>Minor update to the name of the filters</li>\n</ul>\n<p>1.4.0 (April 26, 2016)</p>\n<ul>\n<li>Modularized the code by moving various tasks to own functions</li>\n<li>Added filters for header row and results rows to allow devs to modify and add columns to the CSV files</li>\n</ul>\n<p>1.3.0 (April 6, 2016)</p>\n<ul>\n<li>Added ability to export points earned for each question</li>\n<li>Added ability to export question\'s category</li>\n<li>Fixed bug incorrectly showing the correct/incorrect values</li>\n<li>Added new software license system</li>\n</ul>\n\";}s:7:\"banners\";s:41:\"a:2:{s:4:\"high\";s:0:\"\";s:3:\"low\";s:0:\"\";}\";s:5:\"icons\";s:218:\"a:2:{s:2:\"1x\";s:89:\"https://quizandsurveymaster.com/wp-content/uploads/edd/2020/04/Export-Results-128x128.jpg\";s:2:\"2x\";s:89:\"https://quizandsurveymaster.com/wp-content/uploads/edd/2020/04/Export-Results-256x256.jpg\";}\";s:5:\"added\";s:10:\"2014-12-19\";}s:23:\"qsm-logic/qsm-logic.php\";O:8:\"stdClass\":12:{s:11:\"new_version\";s:5:\"2.0.3\";s:14:\"stable_version\";s:5:\"2.0.3\";s:4:\"name\";s:5:\"Logic\";s:4:\"slug\";s:9:\"qsm-logic\";s:3:\"url\";s:60:\"https://quizandsurveymaster.com/downloads/logic/?changelog=1\";s:12:\"last_updated\";s:19:\"2021-05-03 05:49:57\";s:8:\"homepage\";s:48:\"https://quizandsurveymaster.com/downloads/logic/\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";s:8:\"sections\";a:2:{s:11:\"description\";s:1584:\"<p>Have you ever needed the ability to only show questions when the user answers other questions a certain way? Perhaps you want to only gather more information when a user says the customer service was poor. Or, maybe you want to ask for more information only from users with certain demographics that you determine earlier in your survey.</p>\n<p>This addon allows you to hide or show different questions based on what the user selects for other questions. You can set the addon to show a question when another question\'s answer is equal to a certain answer or if it is not equal to a certain answer. You can also show or hide a question if the selected answer is greater than or less than a given value.</p>\n<p>You can also take things a step further and show or hide questions when more than one questions equal certain values. For example, you could show a question only if the user rated your customer service poorly and said they would not recommend your product.</p>\n<p>Here is an example quick survey using this addon:</p>\n<p>[mlw_quizmaster quiz=26]</p>\n<p>Here is one of the \"rules\" set up for handling the logic of the first question in the example survey above.</p>\n<p>All add-ons can be used indefinitely once purchased. Add-ons include 1 year of support and updates. <a href=\"https://quizandsurveymaster.com/add-ons-terms-and-conditions/\">View license terms</a>. This add-on requires Quiz And Survey Master 6.2.0 or newer.</p>\n<p><a href=\"https://quizandsurveymaster.com/docs/add-ons/logic/\" target=\"_blank\" rel=\"noopener noreferrer\">View Addon\'s Documentation</a></p>\n\";s:9:\"changelog\";s:14209:\"<p>2.0.3 (May 28, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue with multi level quiz.</li>\n<li>Bug: Fixed the issue logic rules not working on retake quiz.</li>\n</ul>\n<p>2.0.2 (April 29, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue of save button not working when trying to add a rule with answer 0.</li>\n<li>Bug: Fixed the issue of additional input box with short answer and number question type.</li>\n<li>Bug: Fixed issues with logic rules when duplicating quiz.</li>\n<li>Feature: Added additional condition for Email template for different answers.</li>\n</ul>\n<p>2.0.1 (April 16, 2021)</p>\n<ul>\n<li>Bug: Fixed issue logic table not created on auto updates.</li>\n<li>Bug: Fixed License validation logic.</li>\n</ul>\n<p>2.0.0 (April 13, 2021)</p>\n<ul>\n<li>Feature: Added option to bulk delete logic rules.</li>\n<li>Feature: Added option to search logic rules.</li>\n<li>Enhancement: New admin UI to create and manage logic rules.</li>\n<li>Enhancement: Upgraded database schema for better performance.</li>\n</ul>\n<p>1.0.9 (January 06, 2021)</p>\n<ul>\n<li>Bug: Fixed multiple rules are not working on same question issue.</li>\n<li>Bug: Fixed logic rules are not working issue when multiple quizzes used on same page.</li>\n</ul>\n<p>1.0.8 (August 20, 2020)</p>\n<ul>\n<li>Bug: Fixed question number issue when logic rules are applied.</li>\n<li>Bug: Fixed wrong update messages.</li>\n<li>Changed: Disabled the logic rules for Auto Pagination( Question Per Page Option ).</li>\n</ul>\n<p>1.0.7 (August 03, 2020)</p>\n<ul>\n<li>Bug: Fixed logic issue for multiple response question answers.</li>\n<li>Bug: Fixed hidden question required issues.</li>\n<li>Bug: Fixed hidden questions on result page.</li>\n</ul>\n<p>1.0.6 (July 21, 2020)</p>\n<ul>\n<li>Enhancement: Added QSM CORE 7.0.0 support.</li>\n</ul>\n<p>1.0.5 (April 22, 2020)</p>\n<ul>\n<li>Feaure: Added logic support for text and number question type</li>\n</ul>\n<p>1.0.4 (March 23, 2020)</p>\n<ul>\n<li>Bug: Child questions not hiding when change in parent question</li>\n</ul>\n<p>1.0.3 (Jan 29, 2020)</p>\n<ul>\n<li>Bug: Not working for certain set of conditions</li>\n</ul>\n<p>1.0.2 (02/22/19)</p>\n<ul>\n<li>Fixes bug preventing all questions from showing in logic editor</li>\n<li>Fixes bug preventing some rules from working in duplicated quizzes</li>\n</ul>\n<p>1.0.1 (02/24/17)</p>\n<ul>\n<li>Fixes bug preventing using Drop Downs in logic</li>\n<li>Removes debugging console logging</li>\n</ul>\n<p>1.0.0 (08/23/16)</p>\n<ul>\n<li>Fixes bug causing sites using PHP 5.2 to crash</li>\n</ul>\n<p>0.1.0Â (06/08/16)</p>\n<ul>\n<li>Initial Release</li>\n</ul>\n<p>2.0.2 (April 29, 2021)</p>\n<ul>\n<li>Bug: Fixed the issue of save button not working when trying to add a rule with answer 0.</li>\n<li>Bug: Fixed the issue of additional input box with short answer and number question type.</li>\n<li>Bug: Fixed issues with logic rules when duplicating quiz.</li>\n<li>Feature: Added additional condition for Email template for different answers.</li>\n</ul>\n<p>2.0.1 (April 16, 2021)</p>\n<ul>\n<li>Bug: Fixed issue logic table not created on auto updates.</li>\n<li>Bug: Fixed License validation logic.</li>\n</ul>\n<p>2.0.0 (April 13, 2021)</p>\n<ul>\n<li>Feature: Added option to bulk delete logic rules.</li>\n<li>Feature: Added option to search logic rules.</li>\n<li>Enhancement: New admin UI to create and manage logic rules.</li>\n<li>Enhancement: Upgraded database schema for better performance.</li>\n</ul>\n<p>1.0.9 (January 06, 2021)</p>\n<ul>\n<li>Bug: Fixed multiple rules are not working on same question issue.</li>\n<li>Bug: Fixed logic rules are not working issue when multiple quizzes used on same page.</li>\n</ul>\n<p>1.0.8 (August 20, 2020)</p>\n<ul>\n<li>Bug: Fixed question number issue when logic