let\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"columnsWidth\":1140,\"horizontalAlign\":\"center\",\"backgroundColor\":\"var(\\u002d\\u002dnv-site-bg)\",\"align\":\"full\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-nogap-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-c8de1056\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-cc947b18\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":100,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":0,\"marginMobile\":0,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"backgroundColor\":\"var(\\u002d\\u002dnv-site-bg)\",\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-cc947b18\"><!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-bd2ecad6\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-bd2ecad6\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-5b1c52fc\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-5b1c52fc\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-c131c19e\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-c131c19e\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"hasCustomCSS\":true} -->\n<h2 id=\"who-info\"><strong>For General Practitioners</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Micronutrients - what is the evidence?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Research has investigated the role of nutrition in the development of mental health issues (Davidson &amp; Kaplan, 2012a; O’Neil et al, 2014 ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Individuals with poor mental health (hauora hinengaro) report nutrient-poor diets when compared to healthy controls (Robson &amp; Gray, 2007; Davidson and Kaplan, 2012b).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>More recent trials have demonstrated efficacy of multi-nutrients (taiora) in improving emotional regulation, reduce stress and improving attention/concentration and hyperactivity symptoms and improving insomnia with no adverse effects (Gariballa &amp; Forster, 2007; Schlebusch et al, 2000; Rucklidge et al, 2014a; Popper, 2014; Lothian et al, 2016).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"what-info\"><strong>What is the trial?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>To test the effectiveness of multi-nutrients on symptoms of anxiety (āwangawanga) and depression (mate pāpōuri) in adults NOT currently taking anti-depressant or anti-anxiety medications.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>200 participants will be randomised to a placebo or treatment condition.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Participation is limited to people living in the Canterbury (Otautahi/Waitaha) region.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The treatment condition will involve taking 12 multi-nutrient tablets per day (4 pills, 3 times a day) for 10 weeks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The trial will also include a 2 week initial baseline phase, where no treatment or placebo will be offered.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Participants will complete initial assessment questionnaires and weekly monitoring of their symptoms.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At the conclusion of the trial, all participants will be offered multi-nutrients for a further 10 weeks in an open trial phase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The trial has been prospectively registered under the Australian and New Zealand Clinical Trials Registry. Trial Identification = ACTRN12617001647325. Universal Trial Number = U111111994026. Ethics approval was granted through the New Zealand Heath and Disability Ethics Committee 17/STH/131 on 14 November 2017 and the University of Canterbury Human Ethics Committee: HEC2017/108/LR, on 27 November 2017.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>The results from the trial will be published when the trial is completed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"participation-info\"><strong>What is the intervention</strong>?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong><em>The multi-nutrient formula that will be used in the trial is Daily Essential Nutrients. The ingredients are as follows:</em></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"backgroundColor\":\"subtle-light-gray\",\"className\":\"is-style-stripes\",\"hasCustomCSS\":true} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-subtle-light-gray-background-color has-background\"><tbody><tr><td><strong>Ingredients:</strong></td><td><strong>1 capsule</strong></td><td><strong>12 capsules</strong></td></tr><tr><td>Vitamin A (as retinyl palmitate)</td><td>480 IU</td><td>5,760 IU</td></tr><tr><td>Vitamin C (as ascorbic acid)</td><td>50 mg</td><td>600 mg</td></tr><tr><td>Vitamin D (as cholecalciferol)</td><td>250 IU</td><td>3,000 IU</td></tr><tr><td>Vitamin E (as d-alpha tocopheryl succinate)</td><td>30 IU</td><td>360 IU</td></tr><tr><td>Vitamin K (75% as phylloquinone; 25% as menaquinone-7)</td><td>10 mcg</td><td>120 mcg</td></tr><tr><td>Thiamin (as thiamin mononitrate)</td><td>4 mg</td><td>60 mg</td></tr><tr><td>Riboflavin</td><td>1.5 mg</td><td>18 mg</td></tr><tr><td>Niacin (as niacinamide)</td><td>7.5 mg</td><td>90 mg</td></tr><tr><td>Vitamin B6 (as pyridoxine hydrochloride)</td><td>5.8 mg</td><td>69.9 mg</td></tr><tr><td>Folate (as L-methylfolate calcium)</td><td>66.8 mcg</td><td>801 mcg</td></tr><tr><td>Vitamin B12 (as methylcobalamin)</td><td>75 mcg</td><td>900 mcg</td></tr><tr><td>Biotin</td><td>90 mcg</td><td>1080 mcg</td></tr><tr><td>Pantothenic acid (as d-calcium pantothenate)</td><td>2.5 mg</td><td>30 mg</td></tr><tr><td>Calcium (as chelate)</td><td>110 mg</td><td>1,320 mg</td></tr><tr><td>Iron (as chelate)</td><td>1.15 mg</td><td>13.8 mg</td></tr><tr><td>Phosphorus (as chelate)</td><td>70 mg</td><td>840 mg</td></tr><tr><td>Iodine (as chelate)</td><td>17 mcg</td><td>204 mcg</td></tr><tr><td>Magnesium (as chelate)</td><td>50 mg</td><td>600 mg</td></tr><tr><td>Zinc (as chelate)</td><td>4 mg</td><td>48 mg</td></tr><tr><td>Selenium (as chelate)</td><td>17 mcg</td><td>204 mcg</td></tr><tr><td>Copper (as chelate)</td><td>0.6 mg</td><td>7.2 mg</td></tr><tr><td>Manganese (as chelate)</td><td>0.8 mg</td><td>9.6 mg</td></tr><tr><td>Chromium (as chelate)</td><td>52 mcg</td><td>624 mcg</td></tr><tr><td>Molybdenum (as chelate)</td><td>12 mcg</td><td>144 mcg</td></tr><tr><td>Potassium (as chelate)</td><td>20 mg</td><td>240 mg</td></tr><tr><td><strong>Proprietary blend ingredients:</strong></td><td></td><td></td></tr><tr><td>Choline bitartrate</td><td></td><td></td></tr><tr><td>Alpha-lipoic acid</td><td></td><td></td></tr><tr><td>Shilajit</td><td></td><td></td></tr><tr><td>Inositol</td><td></td><td></td></tr><tr><td>Acetylcarnitine (as acetyl-L-carnitine hydrochloride)</td><td></td><td></td></tr><tr><td>Grape seed extract</td><td></td><td></td></tr><tr><td>Ginkgo biloba leaf extract</td><td></td><td></td></tr><tr><td>Methionine (as L-methionine hydrochloride)</td><td></td><td></td></tr><tr><td>Cysteine (as N-acetyl-L-cysteine)</td><td></td><td></td></tr><tr><td>Germanium sesquioxide (as chelate)</td><td></td><td></td></tr><tr><td>Boron (as chelate)</td><td></td><td></td></tr><tr><td>Vanadium (as chelate)</td><td></td><td></td></tr><tr><td>Lithium orotate (as chelate)</td><td></td><td></td></tr><tr><td>Nickel (as chelate)</td><td></td><td></td></tr><tr><td><strong>Other ingredients:</strong></td><td></td><td></td></tr><tr><td>Cellulose</td><td></td><td></td></tr><tr><td>Glycine</td><td></td><td></td></tr><tr><td>Citric acid</td><td></td><td></td></tr><tr><td>Magnesium stearate</td><td></td><td></td></tr><tr><td>Silicon dioxide</td><td></td><td></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:paragraph -->\n<p><strong><em>The placebo formula ingredients are as follows:</em></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"backgroundColor\":\"subtle-light-gray\",\"className\":\"is-style-stripes\"} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-subtle-light-gray-background-color has-background\"><tbody><tr><td><strong>Ingredients:</strong></td><td><strong>1 capsule</strong></td><td><strong>12 capsule</strong></td><td></td><td></td></tr><tr><td>Fiber Acacia Gum</td><td>300 mg</td><td>3,600 mg</td><td></td><td></td></tr><tr><td>Maltodextrin</td><td>395.90 mg</td><td>4,750.8 mg</td><td></td><td></td></tr><tr><td>Cocoa Powder</td><td>4 mg</td><td>48 mg</td><td></td><td></td></tr><tr><td>Riboflavin Powder</td><td>0.10 mg</td><td>1.2mg</td><td></td><td></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:heading -->\n<h2><strong>Inclusion and Exclusion criteria</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>INCLUSION:</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>between 18 and 65 years,</li><li>regular access to the internet,</li><li>considered reliable and compliant with the protocol (including the ingestion of as many as 12 capsules/day with food/kai),</li><li>be experiencing functionally impairing anxiety or depressive symptoms which cannot be better accounted for by a medical condition,</li><li>and be living in the Canterbury (Otautahi/Waitaha) area.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>EXCLUSION:</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>The main strict contraindications are metabolic conditions such as Wilson’s disease (copper), haemochromatosis (iron), phenylketonuira (phenylalanine) and trimethylaminuria (choline).</li><li>Neurological disorders involving brain or other central function (e.g., intellectual disability, autism spectrum disorder, epilepsy, MS, narcolepsy) or other major psychiatric condition requiring hospitalization (e.g. significant mood disorder with associated suicidality, substance dependence or psychosis),</li><li>Any serious medical condition,</li><li>Any patient known to be allergic to the ingredients of the intervention (see above).</li><li><strong>Any other medication with primarily central nervous system activity, including psychotropic medication (e.g. SSRIs, tricyclics, benzodiazepines).</strong> Participants must have been off of these medications for a minimum of four weeks prior to the trial. Participants are not encouraged to come off of a medication in order to participate in the trial. All exclusions will be reviewed by study physician.</li><li>There are some other medications that can have interactions with multi-nutrients (e.g. medication for thyroid conditions). Investigators will review potential participants’ medications for interactions and may decline participation in the trial if interactions exist. Please contact us for more information if you are concerned about potential interactions (contact details below).</li><li>Women who are pregnant or breastfeeding.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong><em>For more information on a current trial exploring multi-nutrients, depression and anxiety in pregnancy: </em></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong><em><a rel=\"noreferrer noopener\" href=\"https://www.bit.ly/pregnancy-study\" target=\"_blank\">www.bit.ly/pregnancy-study</a></em></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong>To refer suitable patients to the trial, please provide their details in the form below:</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><em>Please note: information in referral boxes is a guide to completion, not client information.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"466\"} /--></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-3ccc7f3c\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-3ccc7f3c\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-25d41501\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\",\"backgroundColor\":\"var(\\u002d\\u002dnv-text-dark-bg)\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-25d41501\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-9bbf7cd7\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-9bbf7cd7\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-df43b98b\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-df43b98b\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p><strong>References:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Davison, K. M., &amp; Kaplan, B. J. (2012a). Nutrient intakes are correlated with overall psychiatric functioning in adults with mood disorders. <em>Canadian Journal of Psychiatry, 57</em>(2), 85-92.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Davison, K. M., &amp; Kaplan, B. J. (2012b). Food intake and blood cholesterol levels of community-based adults with mood disorders. <em>BMC Psychiatry, 12</em>. doi:10.1186/1471-244X-12-10</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Gariballa, S., &amp; Forster, S. (2007). Effects of dietary supplements on depressive symptoms in older patients: A randomised double-blind placebo-controlled trial. <em>Clinical Nutrition, 26</em>(5), 545-551. doi<a href=\"https://dx.doi.org/10.1016/j.clnu.2007.06.007\">:http://ddoi.org/10.1016/j.clnu.2007.06.007</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lothian, J., Blampied, N.M., &amp; Rucklidge, J.J. (2016). Effect of Micronutrients on Insomnia in Adults: A Multiple-Baseline Study. <em>Clinical Psychological Science, 4</em>(6), 1112-1124.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O’Neil, A., Quirk, S. E., Housden, S., Brennan, S. L., Williams, L. J., Pasco, J. A., . . . Jacka, F. N. (2014). Relationship between diet and mental health in children and adolescents: a systematic review. <em>American journal of public health, 104</em>(10), e31-e42.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Popper, C. W. (2014). Single-Micronutrient and Broad-Spectrum Micronutrient Approaches for Treating Mood Disorders in Youth and Adults. <em>Child and Adolescent Psychiatric Clinics of North America, 23</em>(3), 591-672. doi:10.1016/j.chc.2014.04.001</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Robson, D., &amp; Gray, R. (2007). Serious mental illness and physical health problems: a discussion paper. <em>International journal of nursing studies, 44</em>(3), 457-466.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rucklidge, J. J., Blampied, N., Gorman, B., Gordon, H. A., &amp; Sole, E. (2014). Psychological functioning 1 year after a brief intervention using micronutrients to treat stress and anxiety related to the 2011 Christchurch earthquakes: A naturalistic follow-up. <em>Human Psychopharmacology,&nbsp;</em><em>29</em>(3), 230-243. doi:10.1002/hup.2392</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ruckildge, J.J., Eggleston, M.J.F., Ealam, B., Beaglehole, B., &amp; Mulder, R.T. (2019). An observational preliminary study on the safety of long-term consumption of micronutrients for the treatment of psychiatric symptoms.&nbsp;<em>The Journal of Alternative and Complimentary Medicine,&nbsp;</em>oo(00), 1-10. doi: 10.1089/acm.2018.0352</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rucklidge, J. J., Frampton, C. M., Gorman, B., &amp; Boggis, A. (2014a). Vitamin-mineral treatment of attention-deficit hyperactivity disorder in adults: double-blind randomised placebo- controlled trial. <em>The British Journal of Psychiatry, 204</em>(4), 306</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Schlebusch, L., Bosch, B. A., Polglase, G., Kleinschmidt, I., Pillay, B. J., &amp; Cassimjee, M. H. (2000). A double-blind, placebo-controlled, double-centre study of the effects of an oral multivitamin- mineral combination on stress. <em>S Afr Med J, 90</em>(12), 1216-1223.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Simpson, J. S. A., Crawford, S. G., Goldstein, E. T., Field, C., Burgess, E., &amp; Kaplan, B. J. (2011). Systematic review of safety and tolerability of a complex micronutrient formula used in mental health. <em>BMC Psychiatry, 11</em>. doi:10.1186/1471-244X-11-62</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-af7c4655\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-af7c4655\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->', 'GP\'s & Trial Referral', '', 'publish', 'closed', 'closed', '', 'gps-trial-referral', '', '', '2021-01-11 09:06:53', '2021-01-10 20:06:53', '', 0, 'http://staging.mmp.net.nz/?page_id=2', 0, 'page', '', 0),
(3, 5, '2021-01-11 09:06:53', '2021-01-11 09:06:53', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://staging.mmp.net.nz.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymised string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognise and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->', 'Privacy Policy', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2021-01-11 09:06:53', '2021-01-11 09:06:53', '', 0, 'http://staging.mmp.net.nz/?page_id=3', 0, 'page', '', 0),
