(65, 6, '2021-02-03 14:43:28', '2021-02-03 01:43:28', '<!-- wp:columns {\"align\":\"full\"} -->\n<div class=\"wp-block-columns alignfull\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-6e4084c3\",\"columns\":1,\"layout\":\"equal\",\"columnsGap\":\"nogap\",\"paddingType\":\"unlinked\",\"padding\":180,\"paddingTop\":180,\"paddingBottom\":140,\"marginTop\":0,\"marginBottom\":0,\"backgroundType\":\"image\",\"backgroundImageID\":255,\"backgroundImageURL\":\"https://taioratrial.net/wp-content/uploads/2021/02/nomad-home-scaled.jpg\",\"backgroundPosition\":\"center center\",\"backgroundRepeat\":\"no-repeat\",\"backgroundSize\":\"cover\",\"backgroundOverlayOpacity\":85,\"backgroundOverlayColor\":\"var(\\u002d\\u002dnv-c-2)\",\"align\":\"full\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-nogap-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-6e4084c3\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-6baf5050\",\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-6baf5050\"><!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":33}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:33px\"><strong>The Taiora Trial</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":1,\"style\":{\"typography\":{\"fontSize\":70}},\"textColor\":\"nv-site-bg\",\"hasCustomCSS\":true} -->\n<h1 class=\"has-text-align-center has-nv-site-bg-color has-text-color\" style=\"font-size:70px\"><strong><span class=\"has-inline-