blet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":0,\"marginBottomMobile\":0,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"columnWidth\":\"100\",\"hasCustomCSS\":true} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-d122cf75\"><!-- wp:themeisle-blocks/advanced-heading {\"id\":\"wp-block-themeisle-blocks-advanced-heading-e94aef82\",\"tag\":\"p\",\"align\":\"center\",\"headingColor\":\"var(\\u002d\\u002dnv-c-2)\",\"fontSize\":70,\"fontSizeTablet\":60,\"fontSizeMobile\":37,\"fontFamily\":\"Roboto\",\"fontVariant\":\"700\",\"lineHeight\":69,\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTopTablet\":0,\"paddingTopMobile\":0,\"paddingRightTablet\":0,\"paddingRightMobile\":0,\"paddingBottomTablet\":0,\"paddingBottomMobile\":0,\"paddingLeftTablet\":0,\"paddingLeftMobile\":0,\"marginTablet\":0,\"marginMobile\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginBottom\":60,\"marginBottomTablet\":35,\"marginBottomMobile\":20} -->\n<p id=\"wp-block-themeisle-blocks-advanced-heading-e94aef82\" class=\"wp-block-themeisle-blocks-advanced-heading wp-block-themeisle-blocks-advanced-heading-e94aef82\">Trial information</p>\n<!-- /wp:themeisle-blocks/advanced-heading --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-40d3fa99\",\"columns\":1,\"layout\":\"equal\",\"columnsGap\":\"nogap\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":1,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":0,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"columnsWidth\":1140,\"horizontalAlign\":\"center\",\"backgroundColor\":\"var(\\u002d\\u002dnv-site-bg)\",\"align\":\"full\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-nogap-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-40d3fa99\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-89eb726d\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":100,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":0,\"marginMobile\":0,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"backgroundColor\":\"var(\\u002d\\u002dnv-site-bg)\",\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-89eb726d\"><!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-55a4ce57\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-55a4ce57\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-bc7745c5\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-bc7745c5\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-66519ef8\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-66519ef8\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"hasCustomCSS\":true} -->\n<h2 id=\"who-info\"><strong>Who can participate?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You are likely to be eligible for the trial if:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>You live in Canterbury</li><li>You are between the ages of 18-65</li><li>You are experiencing symptoms of anxiety and/or depression that are getting in the way of your life</li><li>You are not currently taking medication for any mental health issues</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>The full inclusion and exclusion criteria can be found under the Information for General Practitioners tab on this website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"what-info\"><strong>What is a randomised controlled trial (RCT)?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>This randomised controlled trial is exploring whether or not multi-nutrients may improve symptoms of anxiety and depression in adults. The RCT is viewed as the gold standard for testing whether or not treatments work. Participants will be randomly assigned to one of two groups, either the treatment group (who will receive multi-nutrients) or the placebo group (who will receive an identical product that contains no multi-nutrients). Both groups will take placebo or multi-nutrients for 10 weeks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Neither the participant NOR the investigators will know which group participants are in until the end of the study. However, at the end of the RCT phase (after 10 weeks), ALL participants will be offered the opportunity to take the multi-nutrients for a further 10 weeks, regardless of which group they were in. That way, everyone who participates in the study has the chance to try the multi-nutrient intervention.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Multi-nutrients are not a proven treatment for symptoms of anxiety and depression. </strong>For more information about treatments for symptoms of anxiety and depression, please speak to your GP or mental health professional.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The trial has been prospectively registered under the Australian and New Zealand Clinical Trials Registry. Trial Identification = ACTRN12617001647325. Universal Trial Number = U111111994026. Ethics approval was granted through the New Zealand Heath and Disability Ethics Committee 17/STH/131 on 14 November 2017 and the University of Canterbury Human Ethics Committee: HEC2017/108/LR, on 27 November 2017.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once completed, the results of the trial will be published in a peer-reviewed scientific journal. Participants will not be individually identified and their privacy will be protected.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"participation-info\"><strong>What does participation in the trial involve?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You will decide if you may be suitable to participate in this study. We would recommend you discuss your choice to participate with your GP as there are a number of reasons that you might not be able to participate, for example taking additional medications which have interactions with the multi-nutrients. Either you or your GP can make a referral on your behalf to the study. The principal investigator will get in touch with you and will ask you come back to this website where you will create a unique, confidential and secure log-in. You will then be asked to complete a series of questionnaires about your mental health, your general wellbeing and information about your life more generally (e.g. work, education). The questionnaires will take between 30 to 40 minutes approximately to complete. During the study, you will complete this series of questionnaires up to 4 times. After you have completed these questionnaires, the principal investigator will then ring you to discuss the study, ask some final questions and further assess whether or not you will be able to participate in the study. Once you and the principal investigator have established that you are eligible to participate, you will be asked to provide written consent for the study.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your GP will be contacted to let them know whether or not you are eligible for and decided to participate in the study. This is to ensure your safety and to make sure you have the best access to suitable treatment and support. Your GP will have the ability to withdraw you from the study at any time if they think participating may not be appropriate for you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once you have completed the questionnaires on the website, you will then start two weeks of monitoring your overall levels of anxiety, depression, stress and if you think your ability to function is improving or declining. These monitoring questionnaires will be completed on this website, using your unique and confidential log-in.The monitoring questionnaires will take approximately 10 minutes. You will not take either the multi-nutrients or placebo during this baseline period. The purpose of these two weeks is to provide a baseline of your symptoms. We can then measure any change during the next part of the trial against these first two weeks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At the end of the two weeks, you will start the RCT phase of the trial, whereby you will take either multi-nutrients or placebo. You will be asked to take up to 12 pills a day and complete the same weekly monitoring questionnaires.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At the end of the RCT phase (10 weeks), you will be offered the chance to take the multi-nutrients for a further 10 weeks (called an “open label” phase).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Regardless of whether you participate in the open label phase, you will be contacted again 1 year after the baseline monitoring period to complete further online questionnaires. We call this a follow up and it helps us understand if multi-nutrients help people over a longer period of time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Participation in this study will not incur any costs to you. The multi-nutrient and placebo product will be provided to you free of charge. After you have completed the study, you will not receive any further funded multi-nutrients. If you wish to purchase the multi-nutrients, we will assist you to do so at your own cost. The company who provide the multi-nutrient product donate the multi-nutrient product and placebo to the trial. They have no further involvement in the trial, data collection, analysis of results or any subsequent publications. The investigators in the trial have no financial involvement in the company that donate the products to this trial.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-55d729c6\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-55d729c6\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-47b64880\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\",\"backgroundColor\":\"var(\\u002d\\u002dnv-text-dark-bg)\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-47b64880\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-ed18c2a2\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-ed18c2a2\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-660acc05\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-660acc05\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p id=\"team-info\"><strong>If you have any questions or concerns about your mental health or treatment for a mental health issue, please speak to your General Practitioner. Referrals to participate in the study can only be made through self-referral or by your GP.&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Principal Investigator:</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Meredith Blampied</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":365,\"width\":161,\"height\":215,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://staging.mmp.net.nz/wp-content/uploads/2021/02/DSF5061-2-768x1024-1.jpg\" alt=\"\" class=\"wp-image-365\" width=\"161\" height=\"215\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Registered Clinical Psychologist, PhD Student</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Qualifications:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Postgraduate Diploma in Clinical Psychology &nbsp;(University of Canterbury)</li><li>Master of Science Psychology (Distinction) (University of Canterbury)</li><li>Bachelor of Arts with Honours (First Class Honours) (University of Canterbury)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Research interest/experience:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Meredith’s research interests include&nbsp;investigating the role of nutrition in mental health, &nbsp;exploring feedback-informed treatment and best-evidence practice for anxiety disorders, particularly obsessive compulsive disorder. She is also involved in ongoing research on the impact of the Canterbury earthquakes on an anxious population. Meredith has also worked on a number of research project in the areas of child development and learning and social psychology. Meredith has had experience working with adults experiencing a range of mental health issues including anxiety disorders, depression, substance abuse and dependence, adjustment, stress and offending behaviours.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Co-Investigator:</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Professor Julia Rucklidge</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Registered Clinical Psychologist</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Qualifications:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Bachelor of Science (McGill University)</li><li>Master of Science (University of Calgary)</li><li>Doctor of Philosophy (University of Calgary)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Research interest/experience:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Julia’s research interests are centered on the role of nutrition in the expression and treatment of mental illness, from ADHD to depression, to stress following natural disasters. Research methodologies include single case research designs, open label trials and randomised controlled trials. She also has clinical interest and experience in the areas of ADHD, child and adolescent clinical psychology, learning disabilities, youth offending, earthquake research, nutritional interventions, mood disorders.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Additional Research Team Members:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>Dr Caroline Bell</strong> (Psychiatrist, University of Otago)</li><li><strong>Claire Gilbert</strong> (Anxiety Disorders Service, Canterbury District Health Board)</li><li><strong>Associate Professor Joseph Boden</strong> (University of Otago). <em>Assoc. Professor Boden is providing statistical support for the study.</em></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:paragraph -->\n<p><strong>Contact Us</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:contact-form-7/contact-form-selector {\"id\":7,\"title\":\"Contact form 1\"} -->\n<div class=\"wp-block-contact-form-7-contact-form-selector\">[contact-form-7 id=\"7\" title=\"Contact form 1\"]</div>\n<!-- /wp:contact-form-7/contact-form-selector --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-3350162c\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-3350162c\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Trial Information', '', 'publish', 'closed', 'closed', '', 'trial-information', '', '', '2021-02-04 13:43:03', '2021-02-04 00:43:03', '', 0, 'https://staging.mmp.net.nz/?page_id=214', 0, 'page', '', 0),
(423, 6, '2021-02-22 21:43:29', '2021-02-22 08:43:29', '<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-d96370ad\",\"columns\":1,\"layout\":\"equal\",\"columnsGap\":\"wider\",\"paddingType\":\"unlinked\",\"paddingTypeTablet\":\"unlinked\",\"paddingTypeMobile\":\"unlinked\",\"paddingTablet\":20,\"paddingMobile\":20,\"paddingTop\":220,\"paddingTopTablet\":180,\"paddingTopMobile\":75,\"paddingRight\":0,\"paddingRightTablet\":40,\"paddingRightMobile\":25,\"paddingBottom\":50,\"paddingBottomTablet\":130,\"paddingBottomMobile\":75,\"paddingLeft\":0,\"paddingLeftTablet\":40,\"paddingLeftMobile\":25,\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":0,\"marginBottomMobile\":0,\"columnsWidth\":1200,\"horizontalAlign\":\"center\",\"backgroundType\":\"image\",\"backgroundImageURL\":\"\",\"backgroundPosition\":\"bottom center\",\"backgroundRepeat\":\"no-repeat\",\"backgroundSize\":\"cover\",\"backgroundOverlayOpacity\":85,\"backgroundOverlayColor\":\"var(\\u002d\\u002dnv-light-bg)\",\"backgroundOverlayGradient\":\"linear-gradient(135deg,rgba(6,147,227,1) 0%,rgba(113,224,82,0.72) 100%)\",\"align\":\"full\",\"hasCustomCSS\":true} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-wider-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-d96370ad\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-d122cf75\",\"padding\":0,\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":0,\"marginBottomMobile\":0,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-d122cf75\"><!-- wp:themeisle-blocks/advanced-heading {\"id\":\"wp-block-themeisle-blocks-advanced-heading-e94aef82\",\"tag\":\"p\",\"align\":\"center\",\"headingColor\":\"var(\\u002d\\u002dnv-c-2)\",\"fontSize\":70,\"fontSizeTablet\":60,\"fontSizeMobile\":37,\"fontFamily\":\"Roboto\",\"fontVariant\":\"700\",\"lineHeight\":69,\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTopTablet\":0,\"paddingTopMobile\":0,\"paddingRightTablet\":0,\"paddingRightMobile\":0,\"paddingBottomTablet\":0,\"paddingBottomMobile\":0,\"paddingLeftTablet\":0,\"paddingLeftMobile\":0,\"marginTablet\":0,\"marginMobile\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginBottom\":60,\"marginBottomTablet\":35,\"marginBottomMobile\":20,\"hasCustomCSS\":true} -->\n<p id=\"wp-block-themeisle-blocks-advanced-heading-e94aef82\" class=\"wp-block-themeisle-blocks-advanced-heading wp-block-themeisle-blocks-advanced-heading-e94aef82\">Participants &amp; Self Referral</p>\n<!-- /wp:themeisle-blocks/advanced-heading --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-c8de1056\",\"columns\":1,\"layout\":\"equal\",\"columnsGap\":\"nogap\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":1,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":0,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"columnsWidth\":1140,\"horizontalAlign\":\"center\",\"backgroundColor\":\"var(u002du002dnv-light-bg)\",\"align\":\"full\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-nogap-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-c8de1056\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-cc947b18\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":100,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":0,\"marginMobile\":0,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"backgroundColor\":\"var(u002du002dnv-light-bg)\",\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-cc947b18\"><!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-bd2ecad6\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-bd2ecad6\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-5b1c52fc\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-5b1c52fc\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-c131c19e\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-c131c19e\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"hasCustomCSS\":true} -->\n<h2 id=\"who-info\"><strong><strong>Micronutrients: What is the evidence?</strong></strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Research has investigated the role of nutrition in the development of mental health issues (Davidson &amp; Kaplan, 2012a; O’Neil et al, 2014 ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Individuals with poor mental health (hauora hinengaro) report nutrient-poor diets when compared to healthy controls (Robson &amp; Gray, 2007; Davidson and Kaplan, 2012b).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>More recent trials have demonstrated efficacy of multi-nutrients (taiora) in improving emotional regulation, reduce stress and improving attention/concentration and hyperactivity symptoms and improving insomnia with no adverse effects (Gariballa &amp; Forster, 2007; Schlebusch et al, 2000; Rucklidge et al, 2014a; Popper, 2014; Lothian et al, 2016).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The safety profile of multi-nutrient treatment in adults (pakeke) and children (tamariki) is reassuring (Simpson et al, 2011, Rucklidge et al, 2014b; Rucklidge et al, 2019).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"what-info\"><strong>What is the trial?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>To test the effectiveness of multi-nutrients on symptoms of anxiety (āwangawanga) and depression (mate pāpōuri) in adults NOT currently taking anti-depressant or anti-anxiety medications. We are also interested to explore whether or not micronutrients may have an impact on any of the mental health effects generated by the 2020 COVID-19 outbreak.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>200 participants will be randomised to a placebo or treatment condition.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Participation is limited to people living in the Canterbury (Otautahi/Waitaha) region.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The treatment condition will involve taking 12 multi-nutrient tablets per day (4 pills, 3 times a day) for 10 weeks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The trial will also include a 2 week initial baseline phase, where no treatment or placebo will be offered.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Participants will complete initial assessment questionnaires and weekly monitoring of their symptoms.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At the conclusion of the trial, all participants will be offered multi-nutrients for a further 10 weeks in an open trial phase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The trial has been prospectively registered under the Australian and New Zealand Clinical Trials Registry. Trial Identification = ACTRN12617001647325. Universal Trial Number = U111111994026. Ethics approval was granted through the New Zealand Heath and Disability Ethics Committee 17/STH/131 on 14 November 2017 and the University of Canterbury Human Ethics Committee: HEC2017/108/LR, on 27 November 2017. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The results from the trial will be published when the trial is completed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"nv-c-2\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-nv-c-2-background-color has-nv-c-2-color is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 id=\"participation-info\"><strong>What is the intervention</strong>?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong><em>The multi-nutrient formula that will be used in the trial is Daily Essential Nutrients. The ingredients are as follows:</em></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"backgroundColor\":\"subtle-light-gray\",\"className\":\"is-style-stripes\",\"hasCustomCSS\":true} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-subtle-light-gray-background-color has-background\"><tbody><tr><td><strong>Ingredients:</strong></td><td><strong>1 capsule</strong></td><td><strong>12 capsules</strong></td></tr><tr><td>Vitamin A (as retinyl palmitate)</td><td>480 IU</td><td>5,760 IU</td></tr><tr><td>Vitamin C (as ascorbic acid)</td><td>50 mg</td><td>600 mg</td></tr><tr><td>Vitamin D (as cholecalciferol)</td><td>250 IU</td><td>3,000 IU</td></tr><tr><td>Vitamin E (as d-alpha tocopheryl succinate)</td><td>30 IU</td><td>360 IU</td></tr><tr><td>Vitamin K (75% as phylloquinone; 25% as menaquinone-7)</td><td>10 mcg</td><td>120 mcg</td></tr><tr><td>Thiamin (as thiamin mononitrate)</td><td>4 mg</td><td>60 mg</td></tr><tr><td>Riboflavin</td><td>1.5 mg</td><td>18 mg</td></tr><tr><td>Niacin (as niacinamide)</td><td>7.5 mg</td><td>90 mg</td></tr><tr><td>Vitamin B6 (as pyridoxine hydrochloride)</td><td>5.8 mg</td><td>69.9 mg</td></tr><tr><td>Folate (as L-methylfolate calcium)</td><td>66.8 mcg</td><td>801 mcg</td></tr><tr><td>Vitamin B12 (as methylcobalamin)</td><td>75 mcg</td><td>900 mcg</td></tr><tr><td>Biotin</td><td>90 mcg</td><td>1080 mcg</td></tr><tr><td>Pantothenic acid (as d-calcium pantothenate)</td><td>2.5 mg</td><td>30 mg</td></tr><tr><td>Calcium (as chelate)</td><td>110 mg</td><td>1,320 mg</td></tr><tr><td>Iron (as chelate)</td><td>1.15 mg</td><td>13.8 mg</td></tr><tr><td>Phosphorus (as chelate)</td><td>70 mg</td><td>840 mg</td></tr><tr><td>Iodine (as chelate)</td><td>17 mcg</td><td>204 mcg</td></tr><tr><td>Magnesium (as chelate)</td><td>50 mg</td><td>600 mg</td></tr><tr><td>Zinc (as chelate)</td><td>4 mg</td><td>48 mg</td></tr><tr><td>Selenium (as chelate)</td><td>17 mcg</td><td>204 mcg</td></tr><tr><td>Copper (as chelate)</td><td>0.6 mg</td><td>7.2 mg</td></tr><tr><td>Manganese (as chelate)</td><td>0.8 mg</td><td>9.6 mg</td></tr><tr><td>Chromium (as chelate)</td><td>52 mcg</td><td>624 mcg</td></tr><tr><td>Molybdenum (as chelate)</td><td>12 mcg</td><td>144 mcg</td></tr><tr><td>Potassium (as chelate)</td><td>20 mg</td><td>240 mg</td></tr><tr><td><strong>Proprietary blend ingredients:</strong></td><td></td><td></td></tr><tr><td>Choline bitartrate</td><td></td><td></td></tr><tr><td>Alpha-lipoic acid</td><td></td><td></td></tr><tr><td>Shilajit</td><td></td><td></td></tr><tr><td>Inositol</td><td></td><td></td></tr><tr><td>Acetylcarnitine (as acetyl-L-carnitine hydrochloride)</td><td></td><td></td></tr><tr><td>Grape seed extract</td><td></td><td></td></tr><tr><td>Ginkgo biloba leaf extract</td><td></td><td></td></tr><tr><td>Methionine (as L-methionine hydrochloride)</td><td></td><td></td></tr><tr><td>Cysteine (as N-acetyl-L-cysteine)</td><td></td><td></td></tr><tr><td>Germanium sesquioxide (as chelate)</td><td></td><td></td></tr><tr><td>Boron (as chelate)</td><td></td><td></td></tr><tr><td>Vanadium (as chelate)</td><td></td><td></td></tr><tr><td>Lithium orotate (as chelate)</td><td></td><td></td></tr><tr><td>Nickel (as chelate)</td><td></td><td></td></tr><tr><td><strong>Other ingredients:</strong></td><td></td><td></td></tr><tr><td>Cellulose</td><td></td><td></td></tr><tr><td>Glycine</td><td></td><td></td></tr><tr><td>Citric acid</td><td></td><td></td></tr><tr><td>Magnesium stearate</td><td></td><td></td></tr><tr><td>Silicon dioxide</td><td></td><td></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:paragraph -->\n<p><strong><em>The placebo formula ingredients are as follows:</em></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"backgroundColor\":\"subtle-light-gray\",\"className\":\"is-style-stripes\"} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-subtle-light-gray-background-color has-background\"><tbody><tr><td><strong>Ingredients:</strong></td><td><strong>1 capsule</strong></td><td><strong>12 capsule</strong></td><td></td><td></td></tr><tr><td>Fiber Acacia Gum</td><td>300 mg</td><td>3,600 mg</td><td></td><td></td></tr><tr><td>Maltodextrin</td><td>395.90 mg</td><td>4,750.8 mg</td><td></td><td></td></tr><tr><td>Cocoa Powder</td><td>4 mg</td><td>48 mg</td><td></td><td></td></tr><tr><td>Riboflavin Powder</td><td>0.10 mg</td><td>1.2mg</td><td></td><td></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:heading -->\n<h2><strong>Inclusion and Exclusion criteria</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>INCLUSION:</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>between 18 and 65 years,</li><li>regular access to the internet,</li><li>considered reliable and compliant with the protocol (including the ingestion of as many as 12 capsules/day with food/kai),</li><li>be experiencing functionally impairing anxiety or depressive symptoms which cannot be better accounted for by a medical condition,</li><li>and be living in the Canterbury (Otautahi/Waitaha) area.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>EXCLUSION:</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>The main strict contraindications are metabolic conditions such as Wilson’s disease (copper), haemochromatosis (iron), phenylketonuira (phenylalanine) and trimethylaminuria (choline).</li><li>Neurological disorders involving brain or other central function (e.g., intellectual disability, autism spectrum disorder, epilepsy, MS, narcolepsy) or other major psychiatric condition requiring hospitalization (e.g. significant mood disorder with associated suicidality, substance dependence or psychosis),</li><li>Any serious medical condition,</li><li>Any patient known to be allergic to the ingredients of the intervention (see above).</li><li><strong>Any other medication with primarily central nervous system activity, including psychotropic medication (e.g. SSRIs, tricyclics, benzodiazepines).</strong> Participants must have been off of these medications for a minimum of four weeks prior to the trial. Participants are not encouraged to come off of a medication in order to participate in the trial. All exclusions will be reviewed by study physician.</li><li>There are some other medications that can have interactions with multi-nutrients (e.g. medication for thyroid conditions). Investigators will review potential participants’ medications for interactions and may decline participation in the trial if interactions exist. Please contact us for more information if you are concerned about potential interactions (contact details below).</li><li>Women who are pregnant or breastfeeding.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong><em>For more information on a current trial exploring multi-nutrients, depression and anxiety in pregnancy: </em></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong><em><a rel=\"noreferrer noopener\" href=\"https://www.bit.ly/pregnancy-study\" target=\"_blank\">www.bit.ly/pregnancy-study</a></em></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong><strong>To self-refer to the trial, please provide your details in the form below:</strong></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><em><em>Please note: information in referral boxes is a guide to completion, not actual information.</em></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"468\"} /--></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-3ccc7f3c\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-3ccc7f3c\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-25d41501\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\",\"backgroundColor\":\"var(u002du002dnv-text-dark-bg)\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-25d41501\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-9bbf7cd7\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-9bbf7cd7\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-df43b98b\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-df43b98b\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p><strong>References:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Davison, K. M., &amp; Kaplan, B. J. (2012a). Nutrient intakes are correlated with overall psychiatric functioning in adults with mood disorders. <em>Canadian Journal of Psychiatry, 57</em>(2), 85-92.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Davison, K. M., &amp; Kaplan, B. J. (2012b). Food intake and blood cholesterol levels of community-based adults with mood disorders. <em>BMC Psychiatry, 12</em>. doi:10.1186/1471-244X-12-10</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Gariballa, S., &amp; Forster, S. (2007). Effects of dietary supplements on depressive symptoms in older patients: A randomised double-blind placebo-controlled trial. <em>Clinical Nutrition, 26</em>(5), 545-551. doi<a href=\"https://dx.doi.org/10.1016/j.clnu.2007.06.007\">:http://ddoi.org/10.1016/j.clnu.2007.06.007</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lothian, J., Blampied, N.M., &amp; Rucklidge, J.J. (2016). Effect of Micronutrients on Insomnia in Adults: A Multiple-Baseline Study. <em>Clinical Psychological Science, 4</em>(6), 1112-1124.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O’Neil, A., Quirk, S. E., Housden, S., Brennan, S. L., Williams, L. J., Pasco, J. A., . . . Jacka, F. N. (2014). Relationship between diet and mental health in children and adolescents: a systematic review. <em>American journal of public health, 104</em>(10), e31-e42.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Popper, C. W. (2014). Single-Micronutrient and Broad-Spectrum Micronutrient Approaches for Treating Mood Disorders in Youth and Adults. <em>Child and Adolescent Psychiatric Clinics of North America, 23</em>(3), 591-672. doi:10.1016/j.chc.2014.04.001</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Robson, D., &amp; Gray, R. (2007). Serious mental illness and physical health problems: a discussion paper. <em>International journal of nursing studies, 44</em>(3), 457-466.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rucklidge, J. J., Blampied, N., Gorman, B., Gordon, H. A., &amp; Sole, E. (2014). Psychological functioning 1 year after a brief intervention using micronutrients to treat stress and anxiety related to the 2011 Christchurch earthquakes: A naturalistic follow-up. <em>Human Psychopharmacology,&nbsp;</em><em>29</em>(3), 230-243. doi:10.1002/hup.2392</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ruckildge, J.J., Eggleston, M.J.F., Ealam, B., Beaglehole, B., &amp; Mulder, R.T. (2019). An observational preliminary study on the safety of long-term consumption of micronutrients for the treatment of psychiatric symptoms.&nbsp;<em>The Journal of Alternative and Complimentary Medicine,&nbsp;</em>oo(00), 1-10. doi: 10.1089/acm.2018.0352</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rucklidge, J. J., Frampton, C. M., Gorman, B., &amp; Boggis, A. (2014a). Vitamin-mineral treatment of attention-deficit hyperactivity disorder in adults: double-blind randomised placebo- controlled trial. <em>The British Journal of Psychiatry, 204</em>(4), 306</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Schlebusch, L., Bosch, B. A., Polglase, G., Kleinschmidt, I., Pillay, B. J., &amp; Cassimjee, M. H. (2000). A double-blind, placebo-controlled, double-centre study of the effects of an oral multivitamin- mineral combination on stress. <em>S Afr Med J, 90</em>(12), 1216-1223.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Simpson, J. S. A., Crawford, S. G., Goldstein, E. T., Field, C., Burgess, E., &amp; Kaplan, B. J. (2011). Systematic review of safety and tolerability of a complex micronutrient formula used in mental health. <em>BMC Psychiatry, 11</em>. doi:10.1186/1471-244X-11-62</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-af7c4655\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-af7c4655\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->', 'Participants & Self Referral', '', 'publish', 'closed', 'closed', '', 'participants-and-self-referral', '', '', '2021-02-22 21:43:29', '2021-02-22 08:43:29', '', 0, 'https://staging.mmp.net.nz/?page_id=423', 0, 'page', '', 0);
