blet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":0,\"marginBottomMobile\":0,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"columnWidth\":\"100\",\"hasCustomCSS\":true} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-d122cf75\"><!-- wp:themeisle-blocks/advanced-heading {\"id\":\"wp-block-themeisle-blocks-advanced-heading-e94aef82\",\"tag\":\"p\",\"align\":\"center\",\"headingColor\":\"var(\\u002d\\u002dnv-c-2)\",\"fontSize\":70,\"fontSizeTablet\":60,\"fontSizeMobile\":37,\"fontFamily\":\"Roboto\",\"fontVariant\":\"700\",\"lineHeight\":69,\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTopTablet\":0,\"paddingTopMobile\":0,\"paddingRightTablet\":0,\"paddingRightMobile\":0,\"paddingBottomTablet\":0,\"paddingBottomMobile\":0,\"paddingLeftTablet\":0,\"paddingLeftMobile\":0,\"marginTablet\":0,\"marginMobile\":0,\"marginTopTablet\":0,\"marginTopMobile\":0,\"marginBottom\":60,\"marginBottomTablet\":35,\"marginBottomMobile\":20} -->\n<p id=\"wp-block-themeisle-blocks-advanced-heading-e94aef82\" class=\"wp-block-themeisle-blocks-advanced-heading wp-block-themeisle-blocks-advanced-heading-e94aef82\">Community Assistance</p>\n<!-- /wp:themeisle-blocks/advanced-heading --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-40d3fa99\",\"columns\":1,\"layout\":\"equal\",\"columnsGap\":\"nogap\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":1,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":0,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":20,\"marginMobile\":20,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"columnsWidth\":1140,\"horizontalAlign\":\"center\",\"backgroundColor\":\"var(u002du002dnv-light-bg)\",\"align\":\"full\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns alignfull has-1-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-equal-layout has-nogap-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-40d3fa99\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-89eb726d\",\"paddingType\":\"unlinked\",\"paddingTablet\":0,\"paddingMobile\":0,\"paddingTop\":0,\"paddingTopTablet\":20,\"paddingTopMobile\":20,\"paddingRight\":0,\"paddingRightTablet\":20,\"paddingRightMobile\":20,\"paddingBottom\":100,\"paddingBottomTablet\":20,\"paddingBottomMobile\":20,\"paddingLeft\":0,\"paddingLeftTablet\":20,\"paddingLeftMobile\":20,\"marginTypeTablet\":\"linked\",\"marginTypeMobile\":\"linked\",\"marginTablet\":0,\"marginMobile\":0,\"marginTop\":0,\"marginTopTablet\":20,\"marginTopMobile\":20,\"marginRightTablet\":0,\"marginRightMobile\":0,\"marginBottom\":0,\"marginBottomTablet\":20,\"marginBottomMobile\":20,\"marginLeftTablet\":0,\"marginLeftMobile\":0,\"backgroundColor\":\"var(u002du002dnv-light-bg)\",\"columnWidth\":\"100\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-89eb726d\"><!-- wp:themeisle-blocks/advanced-columns {\"id\":\"wp-block-themeisle-blocks-advanced-columns-55a4ce57\",\"columns\":3,\"layout\":\"equal\",\"layoutMobile\":\"collapsedRows\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-columns has-3-columns has-desktop-equal-layout has-tablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-55a4ce57\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-bc7745c5\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-bc7745c5\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-66519ef8\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-66519ef8\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Depression (mate pāpōuri) and anxiety (āwangawanga) are among the most common health issues experienced by adults. The most recent New Zealand Mental Health survey (Te Rau Hinengaro 2006) indicated that approximately 15% of the adult population will experience an anxiety disorder in a year and approximately 7% will experience depression.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Many other people also experience symptoms of anxiety and depression without meeting criteria for a diagnosis. Research also indicates that people experiencing debilitating mixed anxiety and depressive symptoms commonly present to general practitioners (Berardi et al., 1999; Jill M Newby et al., 2013; Nordström &amp; Bodlund, 2008).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The following links contain more information about depression and anxiety. They also include information about various treatment options available for you, your family or whānau.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://www.health.govt.nz/your-health/conditions-and-treatments/mental-health\">http://www.health.govt.nz/your-health/conditions-and-treatments/mental-health</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.mentalhealth.org.nz/\">https://www.mentalhealth.org.nz/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://depression.org.nz/\">https://depression.org.nz/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://www.healthinfo.org.nz/\">http://www.healthinfo.org.nz/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are worried about the safety of yourself or someone you love, mental health crisis support can be found at the following places. Please note, Crisis Resolution Services are available only in Canterbury:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lifeline (Available 24/7) <a href=\"tel:0800543354\">0800 543 354</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depression Helpline (Available 24/7) 0800 111 757 <a href=\"tel:0800543354\">0800 543 354</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Healthline (Available 24/7) <a href=\"tel:0800611116\">0800 611 116</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Samaritans (Available 24/7) <a href=\"tel:0800726666\">0800 726 666</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Suicide Crisis Helpline (Available 24/7) <a href=\"tel:0508 828 865\">0800 543 354</a> (0508 TAUTOKO)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Crisis Resolution Services (Available 24/7) (Canterbury) <a href=\"tel:0800920092\">0800 920 092</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-55d729c6\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-55d729c6\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Community Assistance', '', 'publish', 'closed', 'closed', '', 'community-assistance', '', '', '2021-02-22 21:53:34', '2021-02-22 08:53:34', '', 0, 'https://staging.mmp.net.nz/?page_id=437', 0, 'page', '', 0),
