ablet-equal-layout has-mobile-collapsedRows-layout has-default-gap has-vertical-unset\" id=\"wp-block-themeisle-blocks-advanced-columns-55a4ce57\"><div class=\"wp-block-themeisle-blocks-advanced-columns-overlay\"></div><div class=\"innerblocks-wrap\"><!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-bc7745c5\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-bc7745c5\"></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-66519ef8\",\"columnWidth\":\"69.99\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-66519ef8\"><!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>This is a page to keep you updated with the progress in both the NoMAD trial and also the Maternal Wellbeing and Multi-nutrients trial.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>NoMAD Trial:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>November 2020: After a whirlwind last 6 months, the NoMAD trial is now closed for recruitment. We aim to have data analysed in February-March 2021 and preliminary results released soon after.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>August 2019: We have had a real increase in our referrals over the past five months, welcoming another 35 people into the trial. Te Puna Toiora (The Mental Health and Nutrition Research Group) has also had some excellent media coverage recently, you can see interviews with some of our team (tīma) members here:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.tvnz.co.nz/one-news/new-zealand/vitamin-and-mineral-supplements-ease-adhd-in-children-nz-study?fbclid=IwAR2CWA5L8WdqCS8yu7_5ocWgg5NITr66SPYdfrbHwx1hVHY7c3Czwr6PnwU\">https://www.tvnz.co.nz/one-news/new-zealand/vitamin-and-mineral-supplements-ease-adhd-in-children-nz-study</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please see your GP if you are interested in participating, we are looking to enroll another 100 participants by March 2020!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>March 2019: The NoMAD trial has been steadily increasing in referrals. We currently have 33 people in the study and we are really enjoying supporting people on their mental health (hauora hinengaro) journey. We are continuing to recruit for the trial, in particular for tāne (men). If you are interested in participating, please speak with your GP about the study. More information can be found on this website under the Information for General Practitioners page. We have recently also published the study methods, which can be found here:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.mdpi.com/2305-6320/5/2/56\">https://www.mdpi.com/2305-6320/5/2/56</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>October 2018: Wow, what a busy month for the NoMAD trial! Prof. Julia Rucklidge was featured on SevenSharp and this has generated a lot of interest, not only in the trial but also people wanting information on a nutritional approach to haoura hinengaro (mental health). Please use the contact points on the NoMAD website if you would like more information about this. If you missed the news feature, see the link below. We currently have 15 participants in the trial and are still actively recruiting more. In particular, we are looking to recruit more tāne (men) to the NoMAD trial. So if you, or anyone else you know is experiencing symptoms of anxiety and/or depression, please direct them to this website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.tvnz.co.nz/one-news/new-zealand/micronutrients-could-alternative-treatment-anxiety-and-depression-say-nz-researchers?auto=5846726553001\">https://www.tvnz.co.nz/one-news/new-zealand/micronutrients-could-alternative-treatment-anxiety-and-depression-say-nz-researchers?auto=5846726553001</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>August 2018: We have started recruiting for the trial which is very exciting, with 10 people participating currently. We are aiming to have another 190 people participate over the next 12 to 18 months, so if you’re someone with symptoms of anxiety and/or depression, go and see your GP to discuss whether or not you are suitable for the trial. If you’re a GP, keep us in mind if you have patients that might be suitable for the trial. Meredith is always happy to discuss questions or concerns that you might have. You can contact her under the Information for General Practitioners and Trial Information pages.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Maternal Wellbeing and Multi-nutrients trial:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>November 2020: The Maternal Wellbeing and Multi-nutrients trial is now closed for recruitment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>March 2019: We currently have 45 women who are enrolled in the pregnancy study, 31 of which have already given birth to beautiful healthy babies. We are so excited to have been involved in these gorgeous babies’ journey, and we are really thankful to the women who are giving/have given their time to participate so far. We are also incredibly grateful to the health professionals, friends and whanau who have referred them to us. Hayley is available to answer questions or give more information, contact her at the website below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are looking for pregnant women:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· 12-24 weeks gestation</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· Having one baby</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· Feeling stressed, irritable, anxious or low in mood.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For more information, visit: <a href=\"http://www.bit.ly/nutrimum\">www.bit.ly/nutrimum</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are also looking for women who are pregnant and taking medication for anxiety and/or depression. Please follow the link below to find out more!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>www.bit.ly/babywellbeing</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>August 2018: We currently have 31 women enrolled in the pregnancy study, 19 of which have had beautiful healthy babies and we can’t wait to meet the ones yet to arrive. We need a further 89 women to enrol in the trial to meet our target of 120. We are so grateful for those who have/are participating in the trial and also for health professionals, friends and whanau for referrals. Hayley is available to answer questions or give more information, contact her at the website below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are looking for pregnant women:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· 12-24 weeks gestation</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· Having one baby</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>· Feeling stressed, irritable, anxious or low in mood.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For more information, visit: <a href=\"http://www.bit.ly/nutrimum\">www.bit.ly/nutrimum</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:themeisle-blocks/advanced-column -->\n\n<!-- wp:themeisle-blocks/advanced-column {\"id\":\"wp-block-themeisle-blocks-advanced-column-55d729c6\",\"columnWidth\":\"15.00\"} -->\n<div class=\"wp-block-themeisle-blocks-advanced-column\" id=\"wp-block-themeisle-blocks-advanced-column-55d729c6\"></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns --></div>\n<!-- /wp:themeisle-blocks/advanced-column --></div></div>\n<!-- /wp:themeisle-blocks/advanced-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Trial Updates', '', 'publish', 'closed', 'closed', '', 'trial-updates', '', '', '2021-02-28 18:35:01', '2021-02-28 05:35:01', '', 0, 'https://staging.mmp.net.nz/?page_id=693', 0, 'page', '', 0),
